import React, { Component } from 'react';

class View extends Component {
    render() {

        return (
            <div className="View">
                {this.props.list.map(function (item) {
                    return (
                        <h5 className="card-title">{item.firstName} {item.lastName} ({item.age})</h5>
                    );
                })}
            </div>
        );
    }
}

export default View;
